export default function MapCard(props) {
    const { name } = props

    console.log(name.split(" ").join("-"))

    return (
        <div className="MapCard">
            <img id="map-preview" alt={name} src={`images/maps/${name.split(" ").join("-")}/${name.split(" ").join("-")}.webp`} />
            <p id="map-name">{name}</p>
        </div>
    )
}
